import { Component } from '@angular/core';

@Component({
  selector: 'app-content-site',
  templateUrl: './content-site.component.html',
  styleUrls: ['./content-site.component.scss']
})
export class ContentSiteComponent {

}
<div id="headline" class="contentBox margin100">
  <app-headline></app-headline>

  <div id="aboutMe" class="pt-5">
    <app-about-me></app-about-me>
  </div>

  <div id="mySkills">
    <app-my-skills></app-my-skills>
  </div>

  <div id="portfolio" class="pt-5">
    <app-portfolio></app-portfolio>
  </div>
</div>
